import React from 'react'
import {HiOutlineHeart} from 'react-icons/hi'
import "./HeartRating.css"


export default function HeartRating({index, 
    selectedHeart,
    hoverHeart, 
    onMouseEnter, 
    onMouseLeave,
    onSaveHeart
    }) {
        return (
            <div>
                <HiOutlineHeart
                key={index}
                  index={index}
                  className={index <= (hoverHeart || selectedHeart) ? "selectedHeart" : "heart"}
                  onMouseEnter={onMouseEnter}
                  onMouseLeave={onMouseLeave}
                  onClick={onSaveHeart}

                />

            </div>

        )

    }
